import React from "react";
import Tilt from 'react-parallax-tilt';
import brain from './brain.png';
import './Logo.css';

const Logo = () => {
  return (
    <div className="ma4 mt0">
      <Tilt tiltMaxAngleX={20} tiltMaxAngleY={20} className={"br2 shadow-4"} style={{height: '250px', width: '250px'}}>
        <div className="pa3 tilt">
          <img alt="logo" src={brain}/>
        </div>
      </Tilt>
    </div>
  );
}

export default Logo;
